// Properties.js
import React, { useEffect, useState } from "react";
import "./Properties.css";

const Properties = () => {
  const [properties, setProperties] = useState([]);

  useEffect(() => {
    fetch("https://68b826bcb715405043274639.mockapi.io/api/properties/PropertyListing")
      .then((res) => res.json())
      .then((data) => setProperties(data))
      .catch((err) => console.error(err));
  }, []);

  return (
    <div className="properties-container">
      <div className="properties-header">
        <div>
          <h2>Best Properties Available for Sale</h2>
          <p>Explore top listings in prime locations.</p>
        </div>
        <button className="view-more-btn">View More Properties</button>
      </div>
      <div className="properties-row">
        {properties.map((property) => (
          <div className="property-card" key={property.id}>
            <img src={property.image} alt={property.name} />
            <p className="location">
              {property.buildingNumber}, {property.cardinalDirection}, {property.city}, {property.state}
            </p>
            <p className="rating">‚≠ê 4.7 / 5</p> {/* You can replace with dynamic rating if available */}
            <p className="description">Owner: {property.ownerName}</p>
            <button className="buy-btn">Buy Now</button>
            <p className="price">$350,000</p> {/* Replace with dynamic price if available */}
          </div>
        ))}
      </div>
    </div>
  );
};

export default Properties;
